def plot(x,y,linestyle, label):
    plt.plot(x, y, linestyle, label=label)
    plt.legend()        # 显示上面的label


def ply(name, style):
    x_axis_data = [i for i in range(len(name[1]))]  # x

    plot(x=x_axis_data, y=name[0], linestyle=style, label='ce')
    plot(x=x_axis_data, y=name[1], linestyle=style, label='topk loss')
    plot(x=x_axis_data, y=name[2], linestyle=style, label='focal loss')
    plot(x=x_axis_data, y=name[3], linestyle=style, label='sensitivity specificity loss')
    plot(x=x_axis_data, y=name[4], linestyle=style, label='Classification Loss')


    # plt.xlabel('Epoch Number')               # x_label
    # plt.ylabel('Mean IoU')                    # y_label

    plt.xlabel('Epoch Number')               # x_label
    plt.ylabel('Mean Class Accuracy')

